import React, { Component } from "react";
import "./Landing.css";

export default class Landing extends Component {
    render() {
        let imgUrl = 'http://www.suwanee.com/Home/ShowImage?id=1084&t=636584762163600000'
        let styles = {
          root: {
            backgroundSize: "stretch",
            width: "100%",
            height: "100%",
          }
        }
    
        return ( < div className = "contentview" >
            < div className = "test" >
            < img src = "/static/images/login_page.svg" style ={styles.root} />
            </div>
            </div>
    
            
            );

        }
    }
